import React from "react";

const Navigation = () => {
  return (
    <nav className="flex justify-between" style={{ maxWidth: "1550px" }}>
      {" "}
      <img src="" alt="logo" />
      <div className="flex">
        <ul className="flex">
          <li>Home</li>
          <li>Services</li>
          <li>Promotions</li>
          <li>Our Story</li>
          <li>Contact Us</li>
        </ul>
        <button>Book Online</button>
      </div>
    </nav>
  );
};

export default Navigation;
